import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the first product card to open the modal
    const firstProductCard = page.locator('.product-card').first();
    await firstProductCard.waitFor({ state: 'visible', timeout: 5000 });
    await firstProductCard.click();

    // Wait for the product detail modal to be visible
    const productModal = page.locator('#productModal');
    await productModal.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot of the modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Extract the product title from the modal
    const productTitle = await page.locator('.product-detail-title').textContent();

    return {
      success: true,
      action: "Opened the product detail modal and extracted the product title.",
      extractedData: {
        productTitle: productTitle.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open product detail modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
